SELECT MIN("t34211"."typical_european_movie") AS "typical_european_movie" FROM (SELECT "t34206"."movie_id", "t34208"."movie_id" AS "movie_id0" FROM (SELECT "t34203"."id" AS "id0", "t34205"."movie_id" FROM (SELECT "id" FROM "company_type" WHERE "kind" = 'production companies' GROUP BY "id") AS "t34202" CROSS JOIN (SELECT "id" FROM "info_type" GROUP BY "id") AS "t34203" INNER JOIN (SELECT "movie_id", "company_type_id" FROM "movie_companies" WHERE "note" LIKE '%(theatrical)%' AND "note" LIKE '%(France)%' GROUP BY "movie_id", "company_type_id") AS "t34205" ON "t34202"."id" = "t34205"."company_type_id" GROUP BY "t34203"."id", "t34205"."movie_id") AS "t34206" INNER JOIN (SELECT "movie_id", "info_type_id" FROM "movie_info" WHERE "info" IN ('Denish', 'Denmark', 'German', 'Germany', 'Norway', 'Norwegian', 'Sweden', 'Swedish') GROUP BY "movie_id", "info_type_id") AS "t34208" ON "t34206"."movie_id" = "t34208"."movie_id" AND "t34206"."id0" = "t34208"."info_type_id" GROUP BY "t34206"."movie_id", "t34208"."movie_id") AS "t34209" INNER JOIN (SELECT "id", MIN("title") AS "typical_european_movie" FROM "title" WHERE "production_year" > 2005 GROUP BY "id") AS "t34211" ON "t34209"."movie_id0" = "t34211"."id" AND "t34209"."movie_id" = "t34211"."id"